import React, { Component } from "react";
import { uuid } from "uuidv4";
import { Taille, Sauces, Viandes, Extra } from "./Themenu";

class Sizetacos extends Component {
  state = {
    lesTacos: [
      {
        id: uuid(),
        htmlfor: "XXL",
        img: "./img/sizeTacos/sizeTacos.png",
        nbrViandes: "4 Viandes"
      },
      {
        id: uuid(),
        htmlfor: "XL",
        img: "./img/sizeTacos/sizeTacos.png",
        nbrViandes: "3 Viandes"
      }
    ]
  };
  render() {
    let { lesTacos } = this.state;
    return (
      <>
        <div>
          <img
            src="./img/nav/3.png"
            alt="ok"
            className="w-20 h-20 flex justify-content-center z-1  items-center mx-auto"
          />
          {/* <div className="rounded-full h-20 w-20 z-2  bg-red-900"></div> CIRCLE*/}
          <div className="flex mx-auto items-center">
            <span className="h-10 w-10 bg-yellow-500 px-4 py-2 mx-2 text-white"></span>
            <h2>Taille</h2>
          </div>
          <div className="">
            <Taille lesTacos={lesTacos} />
          </div>
        </div>
      </>
    );
  }
}

export default Sizetacos;
